I'm not sure if this is exactly what you're looking for, but I've created a class that can be used to stack multiple images on top of each other.

```
class StackedImages {
    private var images: [UIImage] = []
    private var iconScale: CGFloat = 0.70

    init(images: [UIImage], iconScale: CGFloat = 0.70) {
        self.images = images
        self.iconScale = iconScale
    }

    func stackImages() -> UIImage {
        let newWidth = images.reduce(0) { $0 + $1.size.width }
        let iconsSize = floor(newWidth * iconScale).rounded(.down)
        let iconsInset = (newWidth - iconsSize) - 1

        let stackedImage = UIImage.createEmptyImage(size: CGSize(width: newWidth, height: iconsSize))

        for (index, image) in images.enumerated() {
            let scaledImage = image.scaledToSize(size: CGSize(width: iconsSize, height: iconsSize))
            let inset = CGRect(x: 0, y: 0, width: iconsInset, height: iconsInset)
            let insetRect = inset.applying(CGAffineTransform(translationX: CGFloat(index) * iconsInset, y: 0))
            stackedImage.draw(in: insetRect, blendMode: .normal, alpha: 1.0)
            scaledImage.draw(in: insetRect, blendMode: .normal, alpha: 1.0)
        }

        return stackedImage
    }
}
```

To use this class, you can create an instance of it with an array of images and an icon scale factor, and then call the `stackImages()` method to get the stacked image.

```
let images = [UIImage(named: "image1"), UIImage(named: "image2"), UIImage(named: "image3")]
let stackedImages = StackedImages(images: images)
let stackedImage = stackedImages.stackImages()
```

